import React from "react";
import WorkCard from "./WorkCard";

import work from "../json/work.json";
const MyWork = () => {
  return (
    <div className=" px-40 flex flex-wrap gap-8 w-screen h-screen">
      <div>
        {work.companies.map((company) => {
          return (
            <WorkCard
              name={company.name}
              type={company.type}
              image={company.src}
              alt={company.name}
            />
          );
        })}
      </div>
    </div>
  );
};

export default MyWork;
